@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'app';
}
<head>
  <style>

    .navbar{
      background-color: pink;
    }
  </style>  
</head>

<nav class="navbar">
  <div class="navbar-brand">
    <a class="navbar-item" href="">
      <img src="./assets/images/educative_logo.png" alt="Educative's angular app" width="170" height="50">
    </a>
  </div>
</nav>

